	'' AS ReceiverIDFEIN,
	'' AS ReceiverIDFiller,
	'' AS ReceiverIDPostalCode,
	-- *INF*: TO_CHAR(SYSDATE,'YYYYMMDD')
	TO_CHAR(CURRENT_TIMESTAMP, 'YYYYMMDD') AS DateTransmissionSent,
	-- *INF*: LPAD(GET_DATE_PART(SYSDATE,'HH24'),2,'0')||LPAD(GET_DATE_PART(SYSDATE,'MM'),2,'0')||LPAD(GET_DATE_PART(SYSDATE,'SS'),2,'0')
	LPAD(DATE_PART(CURRENT_TIMESTAMP, 'HH24'), 2, '0') || LPAD(DATE_PART(CURRENT_TIMESTAMP, 'MM'), 2, '0') || LPAD(DATE_PART(CURRENT_TIMESTAMP, 'SS'), 2, '0') AS TimeTransmissionSent,
	-- *INF*: TO_CHAR(SYSDATE,'YYYYMMDD')
	TO_CHAR(CURRENT_TIMESTAMP, 'YYYYMMDD') AS OriginalTransmissionDate,
	-- *INF*: LPAD(GET_DATE_PART(SYSDATE,'HH24'),2,'0')||LPAD(GET_DATE_PART(SYSDATE,'MM'),2,'0')||LPAD(GET_DATE_PART(SYSDATE,'SS'),2,'0')
	LPAD(DATE_PART(CURRENT_TIMESTAMP, 'HH24'), 2, '0') || LPAD(DATE_PART(CURRENT_TIMESTAMP, 'MM'), 2, '0') || LPAD(DATE_PART(CURRENT_TIMESTAMP, 'SS'), 2, '0') AS OriginalTransmissionTime,
	@{pipeline().parameters.TEST_PRODUCTION_INDICATOR} AS TestProductionInd_H,
