	-- *INF*: TO_INTEGER(XPK_wcn_LineItems)
	CAST(XPK_wcn_LineItems AS INTEGER) AS o_XPK_wcn_LineItems,
	-- *INF*: LENGTH(XPK_wcn_LineItems)
